    "trempealeau-national-wildlife-refuge-quarterly-narrative-report-may-june-july-1941",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Trempealeau NWR
    outlines Refuge accomplishments from May through July of 1941. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, and big game animals- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses. Photographs are attached.",nt"license_title":
